import React, { useEffect, useState } from 'react';
import PocketBase from 'pocketbase';

const pb = new PocketBase('http://127.0.0.1:8090');

export default function VolumeComparisonFinal() {
  const [units, setUnits] = useState([]);

  useEffect(() => {
    async function fetchUnits() {
      try {
        const category = await pb.collection('categories').getFirstListItem('name="Volume"', { autoCancel: false });
        const result = await pb.collection('units').getFullList({
          filter: `category="${category.id}"`,
          sort: 'to_base_factor',
          autoCancel: false
        });
        setUnits(result);
      } catch (err) {
        console.error("Fetch error:", err);
      }
    }

    fetchUnits();
  }, []);

  return (
    <div>
      <h1>Volume Units</h1>
      <ul>
        {units.map(unit => (
          <li key={unit.id}>{unit.name} ({unit.symbol}) - {unit.to_base_factor}</li>
        ))}
      </ul>
    </div>
  );
}
